const Piece = ({
    rank,
    file,
    piece,
}) => {

    const onDragStart = e =>{
        e.dataTransfer.setData('text/plain',`${piece},${rank},${file}`)
        e.target.style.display = 'none'

    }
    return(
         <div className={`piece ${piece} p-${file}${rank}`}
         draggable={true}
         onDragStart={onDragStart}
         />
    )

}

export default Piece
